pragma solidity ^0.4.17;
contract titles {

address[32] public title_holders;
int[32] public title_vins;
uint private next = 0;

//registering a car
function register(int vin) public returns (int) {
	title_holders[next] = msg.sender;
	title_vins[next] = vin;
	next = next + 1;

	return vin;
}

//retrieving the title holders
function get_holders() public view returns (address[32]){
	return title_holders;
	}

//retrieve title vins
function get_vins() public view returns (int[32]){
	return title_vins;
	}
}
